import { Component, OnInit} from '@angular/core';
import { Administrator } from '../modeli/administrator';

@Component({
  selector: 'app-admin-profile',
  templateUrl: './admin-profile.component.html',
  styleUrls: ['./admin-profile.component.css']
})
export class AdminProfileComponent implements OnInit{
  ulogovan: Administrator = new Administrator();

  constructor(){}

  ngOnInit(): void {
    let x = localStorage.getItem("ulogovan");
    if (x != null) {
      this.ulogovan = JSON.parse(x);
    }
  }
}
<h3>Informacije o Administratoru</h3>
Ime: {{ulogovan.ime}} <br>
Prezime: {{ulogovan.prezime}} <br>
Korisnicko ime: {{ulogovan.username}} <br>
Broj telefona {{ulogovan.telefon}} <br>
Uloga: {{ulogovan.tip}}
<hr>
